              isShowCarts={true}
              isShowLables={false}
              isShowText={false}
            />
          }
        />
        <Route
          path="Boxs"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={true}
              isShowText={false}
            />
          }
        />
        <Route
          path="Delivery"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={false}
              isShowLables={false}
              isShowText={true}
              title="Про доставку"
              description="Намагаємось доставити ваше замовлення так швидко, як котик біжить як чує звук відкриття холодильнику.
              Оформлені до 18:00 замовлення відправляємо в той же день!
              Доставка Новою Поштою 1-3 дні. Оплатити можна при отриманні на пошті, або по передплаті на карту."
            />
          }
        />
        <Route
          path="AboutUs"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={false}
              isShowLables={false}
              isShowText={true}
              title="Про нас"
              description="Колись я оновлю цей блок і тут буде інформація про команду і те що ми зробили за весь час."
            />
          }
        />
      </Routes>

      <Feedback />
      <Search />
      <Footer />
    </div>
  );
};

export default App;
